import React, { Component } from "react";
import Grid from "@material-ui/core/Grid";
import Card from "@material-ui/core/Card";
import CardMedia from "@material-ui/core/CardMedia";
import CardActionArea from "@material-ui/core/CardActionArea";
import CardContent from "@material-ui/core/CardContent";
import Typography from "@material-ui/core/Typography";
import { withRouter } from "react-router-dom";

class CardA extends Component {
  constructor(props) {
    super(props);
    this.redirect = this.redirect.bind(this);
  }

  redirect() {
    this.props.history.push("/Project/ProjectAutobattler");
  }

  render() {
    return (
      <Grid item xs={12} sm={3} md={3} >
        <div className="hvr-sweep-to-right2">
          <div className="hvr-sweep-to-right">
            <div className="hvr-sweep-to-right3">
              <Card >
                <CardActionArea
                  onClick={this.redirect}
                  className="card-sweep-to-right"
                >
                  <CardMedia
                    className="card"
                    image={require("./color4.png")}
                    title="1 Star, 2 Star, 3 Star!"
                  />
                  <CardContent>
                    <Typography gutterBottom variant="h5" component="h2">
                      Project Auto battler
                    </Typography>
                    <Typography
                      variant="body3"
                      color="textSecondary"
                      component="p"
                    >
                    <label>Unity3D | Procedural | AI | Pathfinding</label>
                    <div>
                      This project was inspired by DOTA Autochess and a challenge for myself to build out a similar battle system.
                      </div>
                    </Typography>
                  </CardContent>
                </CardActionArea>
              </Card>
            </div>
          </div>
        </div>
      </Grid>
    );
  }
}

export default withRouter(CardA);
